import * as React from 'react';


function Cric() {
  const text = getmatches();
  const name = "Shashank Saxena"
  console.log(name);
  return <div>
    <h1>{name}</h1>
  </div>
}

function getmatches(): Promise<Response> {
  const url = 'https://crictimes.s3.amazonaws.com/scores.json';
  const opts: RequestInit = {
    method: 'GET',
    mode: 'no-cors',
  };
  return fetch(url, opts)
}

export default Cric;
